import React, { Component } from 'react';
import { Container, 
         Navbar, 
         NavbarBrand, 
         NavbarToggler, 
         Collapse, 
         Nav, 
         NavItem, 
         NavLink } from 'reactstrap';
import fireLogo from './fire.png';


class FireNavbar extends Component {
    // Initial state object
    state = {
        isOpen:false
    }
    // toggler Function
    toggle = () => {
        this.setState({
            isOpen: !this.state.isOpen
        })
    }
    // Render navBar 
    render () {
        return (
            <Navbar dark expand="sm" className="mb-5 navbar">
                <Container>
                    <NavbarBrand href=""><img src={fireLogo} className="fire-logo"/></NavbarBrand>
                </Container>
            </Navbar>
        );
    }
};

export default FireNavbar
